INSERT INTO `exercises` (`id`, `name`, `muscle_group`, `description`, `difficulty`, `picture`) VALUES
(1, 'Incline dumbbell bench press', 'Push', 'The Incline Dumbbell Bench Press is a chest exercise where you lie on an inclined bench and lift dumbbells. It specifically targets the upper chest muscles, providing a focused workout for upper body strength and development.', 3, );
INSERT INTO `exercises` (`id`, `name`, `muscle_group`, `description`, `difficulty`, `picture`) VALUES
(2, 'Bench Press', 'Push', 'The Bench Press is a foundational upper body exercise where you lie on a flat bench and lift a barbell. It works the entire chest, shoulders, and triceps, promoting overall upper body strength and muscle development.', 1, );
INSERT INTO `exercises` (`id`, `name`, `muscle_group`, `description`, `difficulty`, `picture`) VALUES
(3, 'Cable Crossover', 'Push', 'The Cable Crossover is a chest exercise where you use cable machines to bring your arms together in front of your body. It targets chest and shoulder muscles, promoting muscle balance and definition in a straightforward manner.', 1, );
INSERT INTO `exercises` (`id`, `name`, `muscle_group`, `description`, `difficulty`, `picture`) VALUES
(4, 'Pull Up', 'Pull', 'The Pull-Up is an upper-body exercise where you hang from a bar and lift your body upward, targeting the back muscles, particularly the latissimus dorsi. It\'s effective for building overall upper body strength and is a common benchmark in strength training.', 2, );
INSERT INTO `exercises` (`id`, `name`, `muscle_group`, `description`, `difficulty`, `picture`) VALUES
(5, 'Back Seated Row', 'Pull', 'The Seated Row is a compound exercise targeting the muscles of the upper back, particularly the latissimus dorsi. While seated, you pull a cable or handle toward your body, engaging the back muscles, biceps, and forearms. It\'s effective for building upper body strength and promoting muscle development in the back.', 1, );
INSERT INTO `exercises` (`id`, `name`, `muscle_group`, `description`, `difficulty`, `picture`) VALUES
(6, 'Barbell Deadlift', 'Pull', 'The Barbell Deadlift is a compound weightlifting exercise focusing on the lower back, glutes, and hamstrings. In this movement, you lift a barbell from the ground to a standing position, maintaining a straight back. The Deadlift engages multiple muscle groups, including the core, lats, and grip muscles. It is a fundamental exercise for overall strength and muscle development, particularly in the posterior chain.', 3, );
INSERT INTO `exercises` (`id`, `name`, `muscle_group`, `description`, `difficulty`, `picture`) VALUES
(7, 'Squat', 'Legs', 'The Squat is a compound exercise targeting the muscles of the lower body, including the quadriceps, hamstrings, and glutes. In this movement, you lower your body by bending the knees and hips, keeping the back straight, and then return to a standing position. Squats are a fundamental strength training exercise, promoting overall lower body strength, stability, and muscle development.', 3, );
INSERT INTO `exercises` (`id`, `name`, `muscle_group`, `description`, `difficulty`, `picture`) VALUES
(8, 'Seated Leg Curl', 'Legs', 'The Seated Leg Curl is an isolation exercise primarily focusing on the muscles of the hamstrings. While seated, you flex your knees to lift a levered pad attached to a weight stack, targeting the back of the thighs. It is effective for strengthening and developing the hamstring muscles, contributing to overall leg strength and stability.', 2, );
INSERT INTO `exercises` (`id`, `name`, `muscle_group`, `description`, `difficulty`, `picture`) VALUES
(9, 'Standing Calf Raise', 'Legs', 'The Standing Calf Raise is an isolation exercise that targets the muscles of the calf, specifically the gastrocnemius and soleus. In this movement, you lift your heels by rising onto the balls of your feet, engaging the calf muscles. Standing Calf Raises are effective for developing calf strength, size, and definition, contributing to overall lower leg aesthetics and functionality.\r\n\r\n\r\n\r\n\r\n', 1, );
INSERT INTO `exercises` (`id`, `name`, `muscle_group`, `description`, `difficulty`, `picture`) VALUES
(10, 'Biceps Curl', 'Arms', 'The Biceps Curl is an isolation exercise focusing on the biceps muscles. During this movement, you lift a weight, typically a dumbbell or barbell, by flexing your elbows. Biceps Curls effectively target the front of the upper arm, promoting strength and muscle development in the biceps brachii. This exercise is commonly included in resistance training routines to enhance arm aesthetics and functional strength.', 1, );
INSERT INTO `exercises` (`id`, `name`, `muscle_group`, `description`, `difficulty`, `picture`) VALUES
(11, 'Triceps Pushdown', 'Arms', 'The Triceps Pushdown is an isolation exercise that targets the triceps muscles, located at the back of the upper arm. This exercise involves using a cable machine with a rope or bar attachment. While standing, you push the attachment downward, extending your elbows against resistance. Triceps Pushdowns are effective for isolating and developing the triceps, contributing to overall arm strength and definition.', 1, );
INSERT INTO `exercises` (`id`, `name`, `muscle_group`, `description`, `difficulty`, `picture`) VALUES
(12, 'Lateral Raise', 'Arms', 'The Lateral Raise is an isolation exercise that primarily targets the deltoid muscles, specifically the lateral or side part of the shoulder. In this movement, you lift weights, often dumbbells, to the side, away from your body. Lateral Raises are effective for developing shoulder width and enhancing the definition of the deltoids. This exercise is commonly included in strength training routines to promote shoulder strength and aesthetics.', 2, );

